import React from "react";

const Card = ({ color, setColor }) => {
  const background = {
    backgroundColor: color,
  };

  function handleColor() {
    setColor('blue')
  }

  return (
    <div onClick={handleColor} style={background}>
      <h2>Set me different color</h2>
    </div>
  );
};

export default Card;
